import React from "react"
import { makeStyles } from '@material-ui/core/styles';


import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import AddShoppingCartIcon from '@material-ui/icons/AddShoppingCart';
// import MenuIcon from '@material-ui/icons/Menu';
import Button from '@material-ui/core/Button';
// import Paper from '@material-ui/core/Paper';
// import Grid from '@material-ui/core/Grid';
import {Link} from "react-router-dom"






const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,

  },
  menuButton: {
    marginLeft: theme.spacing(2),


  },
  title: {
    flexGrow: 1,

  },
}));


export default function ButtonAppBar() {
  const classes = useStyles()

  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" className={classes.title}>
            News
          </Typography >
          <div style={{paddingLeft: "20px"}}>
          <Button style={{background: "none", border:"0px"}} variant="outlined" color="#1c54b2"><Link style={{textDecoration: "none",color:"white"}} to="/">Home</Link></Button>

       <Button variant="outlined" style={{background: "none", border:"0px"}} color="#ede7f6"><Link style={{textDecoration: "none", color:"white"}}to="About">About</Link></Button>


          <Button variant="outlined" style={{background: "none", border:"0px"}} color="#ede7f6"><Link style={{textDecoration: "none", color:"white"}} to="ProductDetail"><IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
            <AddShoppingCartIcon />
          </IconButton></Link></Button>

          </div>







        </Toolbar>
      </AppBar>



    </div>


  );
}
